import React from "react";
const bigSkills = ["being awesome", "bingo"];
const mediumSkills = ["javascript", "bongo"];
const smallSkills = [
  "ruby and thomas the rails engine",
  "ring",
  "a",
  "ting",
  "tongo",
];
let skills = bigSkills.concat(mediumSkills).concat(smallSkills);
for (let i = skills.length - 1; i > 0; i--) {
  let j = Math.floor(Math.random() * (i + 1));
  [skills[i], skills[j]] = [skills[j], skills[i]];
}

function Skills() {
  return (
    <div id="skills-section" className="section">
      <h4>Skills</h4>
      {console.log("skillzzz", skills)}
      <ul id="skills-ul">
        {skills.map((sk) => {
          return (
            <li
              className={
                bigSkills.includes(sk)
                  ? "big-skill"
                  : mediumSkills.includes(sk)
                  ? "medium-skill"
                  : "small-skill"
              }
            >
              sk
            </li>
          );
        })}

        <li className="big-skill">here</li>
        <li>is</li>
        <li>the</li>
        <li className="small-skill">news</li>
        <li>- ELO</li>
      </ul>
      <em>//here are the skills</em>
    </div>
  );
}

export default Skills;
